    playbackData.comments = {"a26ff53c-525d-4932-bee7-202b99cd10ef":[{"id":"ab3a5f21-0dd6-4d9f-87e0-2cb0ad876696","displayCommentEventId":"a26ff53c-525d-4932-bee7-202b99cd10ef","displayCommentEventSequenceNumber":0,"developerGroupId":"9506ce1b-be06-4b31-bdbd-5b7b8350a402","timestamp":1693763980449,"commentText":"In this code story, we introduce function declarations, function types, currying, local bindings, and pattern matching. We also touch on Haskell's order of evaluation and the appropriate use of parentheses.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"c9e56b03-6388-4c13-9f0e-01ea111fdb38":[{"id":"71509bd1-1c93-45aa-b318-065418784efc","displayCommentEventId":"c9e56b03-6388-4c13-9f0e-01ea111fdb38","displayCommentEventSequenceNumber":103,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693764276326,"commentText":"Let's define our first function, to compute the area of a circle. Handily, <span style=\"font-family: Courier;\">pi</span> is a built-in constant, but our function should take the radius <span style=\"font-family: Courier;\">r</span> as a parameter.<div><br></div><div>Notice that functions and parameters should have similar names to variables, starting with a lowercase letter.</div>","commentTitle":"Defining a function","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"circleArea r = pi * r^2","startRow":2,"startColumn":0,"endRow":2,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"circleArea r = pi * r^2","commentTags":[],"questionCommentData":null}],"6ad6dfde-982c-4b47-981b-c25d99ff3f55":[{"id":"8b3f87bb-1ef9-4780-8bfd-4947c835f606","displayCommentEventId":"6ad6dfde-982c-4b47-981b-c25d99ff3f55","displayCommentEventSequenceNumber":138,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693764891730,"commentText":"Functions have types, just like variables.&nbsp; The <span style=\"font-family: Courier;\">circleArea</span> function takes a <span style=\"font-family: Courier;\">Double</span> parameter and returns a <span style=\"font-family: Courier;\">Double</span>. Whenever we see the arrow <span style=\"font-family: Courier;\">-&gt;</span> in a type signature, that tells us we have a function.<div><br></div><div>When we call <span style=\"font-family: Courier;\">circleArea</span>&nbsp;in this example, the literal value 2 is interpreted not as an <span style=\"font-family: Courier;\">Integer</span> but as a <span style=\"font-family: Courier;\">Double</span>.&nbsp;</div><div><br></div><div>If we go to the console and check the type of the literal value 2, we will see that 2 can be interpreted as any type belonging to the <span style=\"font-family: Courier;\">Num</span> typeclass.</div>","commentTitle":"Function and parameter types","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"circleArea :: Double -> Double","startRow":2,"startColumn":0,"endRow":2,"endColumn":30}],"imageURLs":["media/images/1693765377873-Screen-Shot-2023-09-03-at-11.22.30-AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"circleArea :: Double -> Double","commentTags":["image"],"questionCommentData":null}],"1b3cb931-a73d-43e4-8cf0-f117acfa0919":[{"id":"c467b6e0-3a27-4f88-bd7f-66f3ba1290bd","displayCommentEventId":"1b3cb931-a73d-43e4-8cf0-f117acfa0919","displayCommentEventSequenceNumber":267,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693765682357,"commentText":"Let's define another function, to find a person's age in seconds. We supply two parameters, the person's age in years and the number of days since their birthday.<div><br></div><div>If you try to run this example as shown, it won't work. Why not?</div>","commentTitle":"Defining a function with multiple parameters","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"ageInSeconds years days = years * secondsPerYear + days * secondsPerDay\n","startRow":5,"startColumn":0,"endRow":6,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":-1,"currentFilePath":"/main.hs","viewableBlogText":"ageInSeconds years days = years * secondsPerYear + days * secondsPerDay","commentTags":[],"questionCommentData":null}],"fb29b327-1f8d-4042-9f0b-f5e854d4469e":[{"id":"2766fa51-20a9-43fe-aa22-3330ee005aaa","displayCommentEventId":"fb29b327-1f8d-4042-9f0b-f5e854d4469e","displayCommentEventSequenceNumber":553,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693765818090,"commentText":"Of course: We need to define the variables <span style=\"font-family: Courier;\">secondsPerYear</span> and <span style=\"font-family: Courier;\">secondsPerDay</span>. It does not matter whether we define them before or after the function declaration. As usual, we document their types.","commentTitle":"Using variables in a function","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"667c2195-ccfb-4f5c-aa1f-82e72f398675":[{"id":"bf34ce51-444e-4b9a-bfff-b11553e74537","displayCommentEventId":"667c2195-ccfb-4f5c-aa1f-82e72f398675","displayCommentEventSequenceNumber":599,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693766600553,"commentText":"What is the type of the function <span style=\"font-family: Courier;\">ageInSeconds</span>? It takes two <span style=\"font-family: Courier;\">Integer</span> parameters, <span style=\"font-family: Courier;\">years</span> of age and <span style=\"font-family: Courier;\">days</span> since the last birthday, and produces an <span style=\"font-family: Courier;\">Integer</span> result. The way we write this looks a bit strange, but there is a reason for it.<div><br></div><div>In Haskell, all functions are <span style=\"font-style: italic;\">curried</span>. This means that every function takes exactly&nbsp;<span style=\"font-style: italic;\">one</span>&nbsp;parameter. So how can we ever have a function like <span style=\"font-family: Courier;\">ageInSeconds</span> that takes multiple parameters?</div><div><br></div><div>In truth, the function&nbsp;<span style=\"font-family: Courier;\">ageInSeconds</span>&nbsp;really does take just one&nbsp;parameter, <span style=\"font-family: Courier;\">years</span>. The result is a <span style=\"font-style: italic;\">new function</span>. When we call that new function on an appropriate parameter, we will&nbsp;get the final result. Each arrow <span style=\"font-family: Courier;\">-&gt;</span> in the type signature indicates one parameter for one function application.</div><div><br></div><div>Aside: Both the term <span style=\"font-style: italic;\">to curry</span>&nbsp;and the name of the Haskell programming language come from the name of American mathematician <a href=\"https://en.wikipedia.org/wiki/Haskell_Curry\">Haskell Curry</a>, who invented the concept of currying.</div>","commentTitle":"Curried functions","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"ageInSeconds :: Integer -> Integer -> Integer","startRow":5,"startColumn":0,"endRow":5,"endColumn":45}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"ageInSeconds :: Integer -> Integer -> Integer","commentTags":[],"questionCommentData":null},{"id":"88be523c-fa6a-4612-8cdc-881fe6307be3","displayCommentEventId":"667c2195-ccfb-4f5c-aa1f-82e72f398675","displayCommentEventSequenceNumber":599,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693767484961,"commentText":"To elaborate, consider what happens in this function call.&nbsp;<div><br></div><div>Functions applications are evaluated from left to right. First, we evaluate&nbsp;</div><div><br></div><div><span style=\"font-family: Courier;\">ageInSeconds 46</span></div><div><br></div><div>which gives us a new function. And then that new function is called on&nbsp;</div><div><br></div><div><span style=\"font-family: Courier;\">(28+31+30+31+30+31+31+1)</span><br></div><div><br></div><div>which represents the number of days since my birthday (January 31) on the day I wrote up this example (September 1). This gives the final result of&nbsp;1469059200 seconds.</div><div><br></div><div>In the console interaction below, I define a new function <span style=\"font-family: Courier;\">ageInSecondsFromTen</span> years old. I use the new function to find the age of a ten-year-old in seconds on their birthday, 30 days later, and 364 days later.</div><div><br></div><div>If you're feeling shaky on the idea of currying, that's okay. This is just a bit of foreshadowing. We'll see why currying is important later in the semester.</div>","commentTitle":"More on curried functions","position":1,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"ageInSeconds 46 (28+31+30+31+30+31+31+1)","startRow":0,"startColumn":23,"endRow":0,"endColumn":63}],"imageURLs":["media/images/1693767577381-Screen-Shot-2023-09-03-at-11.59.09-AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (ageInSeconds 46 (28+31+30+31+30+31+31+1)))","commentTags":["image"],"questionCommentData":null},{"id":"95b3f6c1-a36e-445f-abd1-d256d605e8a5","displayCommentEventId":"667c2195-ccfb-4f5c-aa1f-82e72f398675","displayCommentEventSequenceNumber":599,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693767512495,"commentText":"<div>One last note (for now) related to function currying.&nbsp;</div><div><br></div><div>With Haskell's left-to-right evaluation, we use parentheses to ensure that function calls are evaluated in the intended order. Try taking out the parentheses to see what happens. Which parentheses are needed and which are not?</div>","commentTitle":"Parentheses ","position":2,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"main = putStrLn (show (ageInSeconds 46 (28+31+30+31+30+31+31+1)))\n","startRow":0,"startColumn":0,"endRow":1,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (ageInSeconds 46 (28+31+30+31+30+31+31+1)))\n","commentTags":[],"questionCommentData":null}],"be94980c-43a5-4a4d-81a9-38a1de135564":[{"id":"7d3b98db-9d37-46d5-a77e-595cd08b899f","displayCommentEventId":"be94980c-43a5-4a4d-81a9-38a1de135564","displayCommentEventSequenceNumber":739,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693767976685,"commentText":"If it bothers you to see all these global variables, we can make them local instead by using a <span style=\"font-family: Courier;\">where</span> clause.<div><br></div><div>Now if we go to the console and type one of these variable names<span style=\"font-family: Courier;\">,</span>&nbsp;we will see something like this:</div><div><br></div><div><span style=\"font-family: Courier;\">error: Variable not in scope: secondsPerYear</span><br></div>","commentTitle":"Local bindings","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"    where\n        secondsPerMinute, minutesPerHour, hoursPerDay :: Integer\n        secondsPerMinute = 60\n        minutesPerHour = 60\n        hoursPerDay = 24\n        daysPerYear = 365\n        secondsPerDay, secondsPerYear :: Integer\n        secondsPerDay = secondsPerMinute * minutesPerHour * hoursPerDay\n        secondsPerYear = daysPerYear * secondsPerDay","startRow":7,"startColumn":0,"endRow":15,"endColumn":52}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    where\n        secondsPerMinute, minutesPerHour, hoursPerDay :: Integer\n        secondsPerMinute = 60\n        minutesPerHour = 60\n        hoursPerDay = 24\n        daysPerYear = 365\n        secondsPerDay, secondsPerYear :: Integer\n        secondsPerDay = secondsPerMinute * minutesPerHour * hoursPerDay\n        secondsPerYear = daysPerYear * secondsPerDay","commentTags":[],"questionCommentData":null}],"e1433da4-ce47-4c5b-a4b6-7573373f4f6b":[{"id":"02c660e3-5f32-44f4-b485-4a2469bb3564","displayCommentEventId":"e1433da4-ce47-4c5b-a4b6-7573373f4f6b","displayCommentEventSequenceNumber":880,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693768724728,"commentText":"Let's define another function, <span style=\"font-family: Courier;\">dogYearsToHuman years</span>.<div><br></div><div>You may have heard that one year of a dog's life is equivalent to seven years of human life. This function reflects that idea.</div><div><br></div><div>However, the truth is more complicated than that. <a href=\"https://www.akc.org/expert-advice/health/how-to-calculate-dog-years-to-human-years/\">The American Kennel Club suggests the following formula:</a></div><div><br></div><div><ul style=\"margin-bottom: 32px; margin-top: 0px; padding-left: 40px; color: rgb(34, 34, 35); font-family: Lato; font-size: 16px; background-color: rgb(255, 255, 255);\"><li style=\"font-size: 1.25rem;\">15 human years equals the first year of a medium-sized dogs life.</li><li style=\"margin-top: 6px; font-size: 1.25rem;\">Year two for a dog equals about nine years for a human.</li><li style=\"margin-top: 6px; font-size: 1.25rem;\">And after that, each human year would be approximately five years for a dog.</li></ul></div><div>But how can we implement that in Haskell?</div>","commentTitle":"Another function","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"dogYearsToHuman :: Integer -> Integer\ndogYearsToHuman years = 7*years","startRow":2,"startColumn":0,"endRow":3,"endColumn":31}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"dogYearsToHuman :: Integer -> Integer\ndogYearsToHuman years = 7*years","commentTags":[],"questionCommentData":null}],"093267ad-021b-4edf-b462-3076e37ee872":[{"id":"36e5e434-aa5f-4725-a617-df36e32f37c0","displayCommentEventId":"093267ad-021b-4edf-b462-3076e37ee872","displayCommentEventSequenceNumber":974,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693769032672,"commentText":"We can use an important feature of Haskell (and some other functional programming languages) called <i>pattern matching.</i><div><i><br></i></div><div>To use pattern matching, we define multiple&nbsp;<i>cases</i>&nbsp;of the function, each case specifying the <i>pattern</i>&nbsp;to which it applies. In this definition, the first case applies to the parameter 1. The second case applies to the parameter 2. And the third case applies to any other parameter value, naming the parameter <span style=\"font-family: Courier;\">n</span>.</div><div><br></div><div>The result of <span style=\"font-family: Courier;\">(dogYearsToHuman 3)</span> is 29, or 15 + 9 + 5(3-1). Try passing other parameters to see if the function does what you expect.</div>","commentTitle":"Pattern matching","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"dogYearsToHuman 3","startRow":0,"startColumn":23,"endRow":0,"endColumn":40}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (dogYearsToHuman 3))","commentTags":[],"questionCommentData":null}],"3576b79c-709a-4bda-a57d-7f57ee71b3b1":[{"id":"2edc31b1-fbf2-44f2-9bc6-ab0ac29c7447","displayCommentEventId":"3576b79c-709a-4bda-a57d-7f57ee71b3b1","displayCommentEventSequenceNumber":1034,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693769326266,"commentText":"It's a bit ugly and error-prone to repeat the numbers 15 and 9 in multiple cases.&nbsp;<div><br></div><div>Instead, let's call <span style=\"font-family: Courier;\">dogYearsToHuman</span> <span style=\"font-style: italic;\">recursively</span> to refer back to the human age of a dog that is one or two years old.</div><div><br></div><div>We'll do more with recursion in next week's lesson.</div>","commentTitle":"Recursive function calls","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"dogYearsToHuman 2 = 9 + dogYearsToHuman 1\ndogYearsToHuman n = 5*(n-2) + dogYearsToHuman 2","startRow":4,"startColumn":0,"endRow":5,"endColumn":47}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"dogYearsToHuman 2 = 9 + dogYearsToHuman 1\ndogYearsToHuman n = 5*(n-2) + dogYearsToHuman 2","commentTags":[],"questionCommentData":null}],"eaecb215-78b2-4055-9414-d78003aa8afc":[{"id":"d7d3a78c-58d9-4c51-b96a-deacd96b4f53","displayCommentEventId":"eaecb215-78b2-4055-9414-d78003aa8afc","displayCommentEventSequenceNumber":1158,"developerGroupId":"d600855e-71e1-4918-b17a-cff9c0710393","timestamp":1693769849615,"commentText":"<div>Here's one last example function, <span style=\"font-family: Courier;\">writeNumber</span>. This example is here for two reasons:</div><div><br></div><div>1. It reminds us that functions can have <span style=\"font-family: Courier;\">String</span> results or parameters.</div><div><br></div><div>2. It introduces the use of the underscore <span style=\"font-family: Courier;\">_</span> as a <span style=\"font-style: italic;\">wildcard</span>&nbsp;in pattern matching. We use a wildcard when a parameter is not used in the expression that defines the result, so the parameter's value doesn't matter.&nbsp;</div><div><br></div><div>After you run this code, go to the console and try calling <span style=\"font-family: Courier;\">writeNumber</span> with various parameters.</div>","commentTitle":"Wildcards in pattern matching","position":0,"selectedCodeBlocks":[{"fileId":"79ac0426-9f18-4f06-944e-17d4d3c70a2f","selectedText":"writeNumber :: Integer -> String\nwriteNumber 0 = \"zero\"\nwriteNumber 1 = \"one\"\nwriteNumber 2 = \"two\"\nwriteNumber _ = \"many\"","startRow":7,"startColumn":0,"endRow":11,"endColumn":22}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"writeNumber :: Integer -> String\nwriteNumber 0 = \"zero\"\nwriteNumber 1 = \"one\"\nwriteNumber 2 = \"two\"\nwriteNumber _ = \"many\"","commentTags":[],"questionCommentData":null}]};
